"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Uterine artery embolization (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H89192433\">",
"      <span class=\"h1\">",
"       What is uterine artery embolization?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Uterine artery embolization (also called &ldquo;UAE&rdquo;) is a treatment for fibroids. Fibroids are abnormal growths of tissue that form in the uterus, the part of the woman&rsquo;s body that holds the baby if she is pregnant.",
"     </p>",
"     <p>",
"      UAE is also called &ldquo;uterine fibroid embolization.&rdquo; It works by blocking the blood vessels that supply blood to fibroids, causing them to shrink. It is 1 of several ways doctors treat fibroids.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H89192448\">",
"      <span class=\"h1\">",
"       Why might a woman get UAE?",
"      </span>",
"      &nbsp;&mdash;&nbsp;UAE helps ease the heavy bleeding and lower belly pressure caused by fibroids. Compared with surgery to treat fibroids, UAE:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Takes less time",
"       </li>",
"       <li>",
"        Does not require any cuts (incisions) in the belly",
"       </li>",
"       <li>",
"        Has a shorter recovery time",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H89192463\">",
"      <span class=\"h1\">",
"       What are the downsides of UAE?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Compared with women treated with surgery, women treated with UAE are more likely to need a second surgery to control heavy bleeding.",
"     </p>",
"     <p>",
"      UAE does not work well on certain types of fibroids. Also, women who want to get pregnant in the future should not have UAE. Your doctor can help you decide if UAE is right for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H89192478\">",
"      <span class=\"h1\">",
"       What happens during UAE?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are having UAE, you will be treated in a hospital. You will get medicines (called &ldquo;anesthesia&rdquo;) to block pain in the lower half of your body and to make you feel relaxed. But you will stay awake.",
"     </p>",
"     <p>",
"      The doctor will then insert a thin tube (called a &ldquo;catheter&rdquo;) into the artery at the top of 1 leg and advance it up to your uterus. With the tube in place, the doctor will inject a special dye that can be seen on X-rays to show the arteries that bring blood to the fibroid. Next, the doctor will inject tiny plastic beads into the artery to block the blood flow to the fibroid (",
"      <a class=\"graphic graphic_figure graphicRef86790 \" href=\"UTD.htm?4/15/4340\">",
"       figure 1",
"      </a>",
"      ). Afterward, the doctor will repeat the same steps on the other side. The procedure takes about 1 hour. You will likely stay in the hospital overnight, where nurses can check you and give you pain medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H89192512\">",
"      <span class=\"h1\">",
"       What happens after UAE?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most women have lower belly pain and cramping after the procedure. These symptoms are usually worst the first 2 days after the procedure and can last up to 7 days. Some women have discharge or bleeding from the vagina for 2 weeks after UAE. Sometimes, the bleeding lasts for months.",
"     </p>",
"     <p>",
"      Some women also:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feel sick to their stomach (nausea)",
"       </li>",
"       <li>",
"        Throw up (vomit)",
"       </li>",
"       <li>",
"        Have a fever",
"       </li>",
"       <li>",
"        Feel tired and achy",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you have these symptoms, your doctor can prescribe pain relievers and other medicines to treat them.",
"     </p>",
"     <p>",
"      You should see your doctor for several follow-up visits during the first year to check that the procedure worked.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H89192529\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It is possible to get pregnant after UAE. But after UAE, pregnancy might not be safe for either the mother or the baby. Because of this, doctors advise women who want to get pregnant NOT to have this procedure. They also advise women to use birth control after the procedure to avoid pregnancy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H89192544\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?20/52/21314?source=see_link\">",
