" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 519px\">",
"   <div class=\"ttl\">",
"    Monosodium urate crystals",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 499px; height: 335px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
