"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      National Institute for Occupational Safety and Health (NIOSH), \"NIOSH List of Antineoplastic and Other Hazardous Drugs in Healthcare Settings 2012.\" Available at",
"      <a href=\"file://www.cdc.gov/niosh/docs/2012-150/pdfs/2012-150.pdf\" target=\"_blank\">",
"       file://www.cdc.gov/niosh/docs/2012-150/pdfs/2012-150.pdf",
"      </a>",
"      . Accessed January 21, 2013.",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Sims EK, Garnett S, Guzman F, et al, \"Fulvestrant Treatment of Precocious Puberty in Girls With McCune-Albright Syndrome,\"",
"      <i>",
"       Int J Pediatr Endocrinol",
"      </i>",
"      , 2012, 2012(1):26.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
